import SeatElement from "../Elements/SeatElement";

function SeatsPanel({ currentTrain }) {
  return (
    <>
      
      <h2>Active Trains</h2>
      {currentTrain.wagons.map((train, index) =>(
        <button key={index} onClick={() => handleTrainClick(train)}>
          {train.name}
        </button>
      ))}

    </>
  );
}
  
export default SeatsPanel;
